from VariantValidator import Validator
from unittest import TestCase


class TestVariantsAuto(TestCase):

    @classmethod
    def setup_class(cls):
        cls.vv = Validator()

    def test_variant1(self):
        variant = 'NM_015120.4:c.35T>C'
        results = self.vv.validate(variant, 'GRCh37', 'all').format_as_dict(test=True)
        print(results)

        assert results['flag'] == 'gene_variant'
        assert 'NM_015120.4:c.35T>C' in list(results.keys())
        assert results['NM_015120.4:c.35T>C']['submitted_variant'] == 'NM_015120.4:c.35T>C'
        assert results['NM_015120.4:c.35T>C']['gene_symbol'] == 'ALMS1'
        assert results['NM_015120.4:c.35T>C']['gene_ids'] == {'hgnc_id': 'HGNC:428', 'entrez_gene_id': '7840',
                                                              'ucsc_id': 'uc032nrd.1', 'omim_id': ['606844']}
        assert results['NM_015120.4:c.35T>C']['hgvs_transcript_variant'] == 'NM_015120.4:c.35T>C'
        assert results['NM_015120.4:c.35T>C']['genome_context_intronic_sequence'] == ''
        assert results['NM_015120.4:c.35T>C']['refseqgene_context_intronic_sequence'] == ''
        assert results['NM_015120.4:c.35T>C']['hgvs_refseqgene_variant'] == 'NG_011690.1:g.5146T>C'
        assert results['NM_015120.4:c.35T>C']['hgvs_predicted_protein_consequence'] == {
            'tlr': 'NP_055935.4:p.(Leu12Pro)', 'slr': 'NP_055935.4:p.(L12P)'}
        assert results['NM_015120.4:c.35T>C']['hgvs_lrg_transcript_variant'] == 'LRG_741t1:c.35T>C'
        assert results['NM_015120.4:c.35T>C']['hgvs_lrg_variant'] == 'LRG_741:g.5146T>C'
        self.assertCountEqual(results['NM_015120.4:c.35T>C']['alt_genomic_loci'], [])
        assert results['NM_015120.4:c.35T>C']['primary_assembly_loci']['hg19'] == {
            'hgvs_genomic_description': 'NC_000002.11:g.73613031T>C',
            'vcf': {'chr': 'chr2', 'pos': '73613031', 'ref': 'T', 'alt': 'C'}}
        assert results['NM_015120.4:c.35T>C']['primary_assembly_loci']['hg38'] == {
            'hgvs_genomic_description': 'NC_000002.12:g.73385903T>C',
            'vcf': {'chr': 'chr2', 'pos': '73385903', 'ref': 'T', 'alt': 'C'}}
        assert results['NM_015120.4:c.35T>C']['primary_assembly_loci']['grch37'] == {
            'hgvs_genomic_description': 'NC_000002.11:g.73613031T>C',
            'vcf': {'chr': '2', 'pos': '73613031', 'ref': 'T', 'alt': 'C'}}
        assert results['NM_015120.4:c.35T>C']['primary_assembly_loci']['grch38'] == {
            'hgvs_genomic_description': 'NC_000002.12:g.73385903T>C',
            'vcf': {'chr': '2', 'pos': '73385903', 'ref': 'T', 'alt': 'C'}}
        assert results['NM_015120.4:c.35T>C']['reference_sequence_records'] == {
            'transcript': 'https://www.ncbi.nlm.nih.gov/nuccore/NM_015120.4',
            'protein': 'https://www.ncbi.nlm.nih.gov/nuccore/NP_055935.4',
            'refseqgene': 'https://www.ncbi.nlm.nih.gov/nuccore/NG_011690.1',
            'lrg': 'http://ftp.ebi.ac.uk/pub/databases/lrgex/LRG_741.xml'}

